import * as React from 'react';
import {
  Box,
  Container,
  Typography,
  Paper,
  Grid,
  Avatar,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableRow,
  useTheme,
  useMediaQuery,
} from '@mui/material';

// Beispieldaten für ein einzelnes Team.
// In einer echten Anwendung würden diese Daten von einer API kommen.
const teamData = {
  id: 1,
  name: 'Rakete Freiburg',
  logoColor: '#D32F2F',
  contact: 'kontakt@rakete-freiburg.de',
  memberSince: '2010',
};

// Sub-Komponente für die Team-Karte
const TeamCard = ({ team }) => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  // Daten für die Anzeige in einer strukturierten Form
  const details = [
      { label: 'Teamname', value: team.name },
      { label: 'Kontakt', value: team.contact },
      { label: 'Mitglied seit', value: team.memberSince },
  ];

  return (
    <Paper
      sx={{
        p: { xs: 2, sm: 3 },
        backgroundColor: '#1C1C1C',
        borderRadius: theme.shape.borderRadius,
        border: `1px solid ${theme.palette.grey[800]}`,
      }}
    >
      <Grid container spacing={isMobile ? 2 : 4} alignItems="center">
        {/* Linke Spalte: Logo */}
        <Grid item xs={12} sm={4} sx={{justifyContent: 'center', alignItems: 'center' }}>
            <Box width={'100%'} alignItems={'center'} justifyContent={'center'} sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
          <Avatar
            sx={{
              width: { xs: 100, sm: 140 },
              height: { xs: 100, sm: 140 },
              backgroundColor: team.logoColor,
              color: theme.palette.getContrastText(team.logoColor),
              fontSize: { xs: '3rem', sm: '4.5rem' },
              fontFamily: 'comfortaa',
              fontWeight: 'bold',
            }}
          >
            {team.name.substring(0, 1).toUpperCase()}
          </Avatar>
          </Box>
        </Grid>

        {/* Rechte Spalte: Team-Daten */}
        <Grid item xs={12} sm={8}>
          {isMobile ? (
            // Mobile Ansicht: Gestapelte Liste
            <Box>
              {details.map((detail) => (
                <Box key={detail.label} sx={{ mb: 1.5 }}>
                  <Typography
                    component="div"
                    sx={{
                      fontFamily: 'comfortaa',
                      fontWeight: 600,
                      color: theme.palette.grey[200],
                      fontSize: '0.9rem',
                      mb: 0.25,
                    }}
                  >
                    {detail.label}:
                  </Typography>
                  <Typography
                    component="div"
                    sx={{
                      fontFamily: 'comfortaa',
                      color: theme.palette.grey[300],
                      fontSize: '0.9rem',
                      wordBreak: 'break-all',
                    }}
                  >
                    {detail.value}
                  </Typography>
                </Box>
              ))}
            </Box>
          ) : (
            // Desktop Ansicht: Tabelle
            <TableContainer>
              <Table aria-label={`Daten für ${team.name}`}>
                <TableBody>
                  {details.map((detail) => (
                    <TableRow key={detail.label}>
                      <TableCell sx={{ fontFamily: 'comfortaa', fontWeight: 600, color: theme.palette.grey[200], border: 'none', p: 1, width: 130 }}>
                        {detail.label}:
                      </TableCell>
                      <TableCell sx={{ fontFamily: 'comfortaa', color: theme.palette.grey[300], border: 'none', p: 1, wordBreak: 'break-all' }}>
                        {detail.value}
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          )}
        </Grid>
      </Grid>
    </Paper>
  );
};


const TeamPage = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <Container maxWidth="md" sx={{ my: 4, px: isMobile ? 2 : 3 }}>
      <Typography
        variant={isMobile ? 'h4' : 'h3'}
        component="h1"
        sx={{
          mb: 4,
          mt: 2,
          color: '#00A99D',
          fontWeight: 700,
          fontFamily: 'comfortaa',
          textAlign: 'center',
          textTransform: 'uppercase',
          letterSpacing: '0.1em',
        }}
      >
        {teamData.name}
      </Typography>
      
      <TeamCard team={teamData} />
      
    </Container>
  );
};

export default TeamPage;
